import React, { Component } from "react";
import axios from "axios";
import {NavLink} from "react-router-dom";


class Cart extends Component {
    _isMounted = false;
  
    constructor(props) {
      super(props);
      this.state = {
          cart: []
        
      };
  
      this.props = props;
    }
  
    componentDidMount = () => {
      this._isMounted = true;
      this.fetchData(this.props.match.params.category);
  
    };


    fetchData = () => {
        axios
          .get("/api/cart")
          .then((response) => {
            if (this._isMounted) {
              this.setState({
                cart: response.data
              });
  
    
              
            }
          })
          .catch((error) => {
            console.log(error);
          });
      };
      
      render() {

        const cart = this.state.cart.items.map((item) => (
          <NavLink to={"/shop/" + item.category + "/" + item.productId}>
          <div>{item.product_id}</div>
          <div>{item.price}</div>
          </NavLink>
        ));

          return (
            <div>{cart}</div>
          )
      }
    }

    export default Cart;
